import slimetrail._ /** Tree strucure to represent the DOM */
sealed trait Html[+A] { final def render: Node = ??? // Replace by actual code final def map[B](f: A => B): Html[B] = ??? // Replace by actual code
}
final case class ATextNode(value: String) extends Html[Nothing]
final case class AnElement[+A]( namespace: String, tag: String, attributes: Map[(Option[String], String), String], eventListeners: List[(String, js.Function1[_ <: Event, A])], children: List[Html[A]] ) extends Html[A] /** Generic Web Application */
trait WebApplication extends Application { def view(model: Model): Html[Msg] final def run(initialNode: Node): Unit = ??? // Replace by actual code
} /** The Slimetrail Web Application */
final class SlimetrailWebApp(size: Int) extends SlimetrailApp(size) with WebApplication { def view(m: GameState): Html[Msg] = ??? // Replace by actual code
} object Main { def onLoading(a: => Unit): Unit = document.addEventListener("DOMContentLoaded", (_: Event) => a) def main(args: Array[String]): Unit = onLoading { new SlimetrailWebApp(10) .run(document.getElementById("scalajs-controlled-node")) }
} The WebApplication trait is the exact Web counterpart of the TextApplication trait. The view method of WebApplication, just like in TextApplication, takes the current state of the application (GameState for Slimetrail ) as input and produce events (Action for Slimetrail ) that will be sent to update in order to compute the new state of the application and so on. The two differences with TextApplication are: the Web UI needs to render some HTML/SVG/CSS in a browser page via the DOM instead of lines of text in a terminal console. the Web UI needs to produce user Action from DOM Events instead of reading lines from the keyboard. To produce the JavaScript you have two options: sbt web/fastOptJS will compile the web project into a JavaScript file at web/target/scala-2.12/slimetrail-web-fastopt.js fast but without much optimizations. sbt web/fullOptJS will compile the web project into an optimized JavaScript file at web/target/scala-2.12/slimetrail-web-opt.js. Run bin/genHtml.sh to produce both fast.html and full.html which run the application using the corresponding JavaScript file.

