Recommended time to spend on this part: 30 minutes Recommended finishing before: 9:45am The console panel is a JavaScript REPL . Enter the following JavaScript code and watch the effects on the page: let x = "Welcome ";
x; x = x + "to the console"; console.log(x); document.body .appendChild(document.createTextNode("Hello")); The structure of the page, exposed in the inspector panel, is (more or less) an XML tree made of Node . There are different kind of nodes such as Text nodes which are leaves representing some text or Element nodes which represent an HTML or SVG tag such as div, span, body, svg and many others. As you can see in the inspector Element nodes can have sub-nodes that are called children and key/value pairs attached to them called Attributes . We will only use Text and Element nodes in this session. One of the most important concept is the document , it represents the page. You can access it simply with document. It provides many of the main functions we will use: document.getElementById get an Element node by its id attribute. Try the following code in the console. Observe the result and find the node in the inspector: let rules = document.getElementById("rules");
rules; document.createTextNode creates a Text node but does not attach it to the page yet! Try the following code in the console. Observe the result and try to find it in the inspector: let mytextnode = document.createTextNode("I am a text node");
mytextnode; element.appendChild add a node to the children of the element. Try the following code in the console. What change do you see on the page? Find the mytextnode in the inspector: rules.appendChild(mytextnode); element.replaceChild replace a node that is a child of the element by another node. Try this in the console: let mynewtextnode = document.createTextNode("I am the new text node");
rules.replaceChild(mynewtextnode, mytextnode); Observe the effect on the page. Using the inspector, notice what happend. document.createElementNS creates a new Element node but does not attach it to the page yet. Note that this function requires an argument called the namespace . A tag may have several meaning depending on the context, how does the browser know how to interpret it? Take a address tag for example, is it a postal address? Or an email address maybe? To avoid ambiguity, we can make clear what is the meaning of a tag by defining its namespace . We will use two namespaces in this session: The HTML namespace tells the browser the node is to be interpreted as an HTML node. Its value is "http://www.w3.org/1999/xhtml". The SVG namespace tells the browser the node is to be interpreted as an SVG node. Its value is "http://www.w3.org/2000/svg". Using the HTML namespace for a SVG node will result in the browser treating it as an HTML node and thus misbehaving. Be very careful about that, always give the correct namespace. Try the following code in the console. Add the element to the page and observe the result in the inspector: let myhtmlelement = document.createElementNS("http://www.w3.org/1999/xhtml", "h1");
myhtmlelement; Try the following code in the console. Add the element to the page and observe the result in the inspector: let mysvgelement = document.createElementNS("http://www.w3.org/2000/svg", "polygon"); mysvgelement; element.setAttributeNS set an attribute on the element. Attributes can also have a namespace but unlike elements it is optional. Try the following code in the console. Observe the effects on myhtmlelement in the inspector. myhtmlelement.setAttributeNS( undefined, "akey", "avalue");
myhtmlelement; myhtmlelement.setAttributeNS( undefined, "akey", "newvalue");
myhtmlelement; myhtmlelement.setAttributeNS( "http://www.w3.org/1999/xlink", "xlink", "anothervalue");
myhtmlelement; Node.parentNode returns the parent node if it exists. Try the following code in the console. Find the parent node in the inspector. let rulesParent = rules.parentNode;
rulesParent; Node.addEventListener attach a reaction to an event on this node. Try the following code in the console. Then click on the page to observe the result. function reaction1(event) { alert("Event received and reaction triggered!");
}
document.body.addEventListener("click", reaction1); Event.stopPropagation prevents further propagation of the current event in the capturing and bubbling phases . function reaction2(event) { event.stopPropagation(); alert("Event received, reaction triggered but no further propagation!");
}
document.body.addEventListener("click", reaction2); By default, JavaScript code in a page can be executed before the page is fully loaded. Code that need the page to be fully loaded can set themselves as an event listener on document for the DOMContentLoaded event. function reaction3(event) { alert("I will be executed when the page is fully loaded");
}
document.addEventListener("DOMContentLoaded", reaction3); These are the few functions you need to use to create or modify the page structure from JavaScript .

